commit_list.message:
fix bug

caused by (minicode.h #117):
  bytes[0] = (u & 077000000) >> 18;
should be:
  bytes[0] = (u & 077000000) >> 18 | 0360;

add token defines

tokens are stored in the class Token, and there are five kinds of tokens;
use macros to define keywords and punctuators, inspired by clang.
